import React, { Component } from "react";
import VideoPlayer from "react-video-js-player";
import UserService from "../services/user.service";

export default class BoardUser extends Component {


  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }



  componentDidMount() {
    UserService.getUserBoard().then(
      response => {
        this.setState({
          content: response.data
        });
      },
      error => {
        this.setState({
          content:
            (error.response &&
              error.response.data &&
              error.response.data.message) ||
            error.message ||
            error.toString()
        });
      }
    );
  }



  render() {
    return (

      <div id="parent">
      <h1>Todays Workout</h1>
      <h3>Warm Up</h3>
      <VideoPlayer src="http://d1npt7ns5uaxtu.cloudfront.net/clip1.mp4" width="720 height=420"/>
      <p>Peform these 3 stretches prior to your workout</p>



</div>
    );
  }
}
